import PropTypes from "prop-types";
import { Carousel } from "../../../../components";
import { IoMdArrowRoundBack } from "react-icons/io";

export const SelectDay = ({ program, next, prev, step }) => {
  console.log(program, next, prev, step);
  const { days } = program;
  return (
    <div className="d-block pt-5">
      <div className="text-start">back</div>
      <h2 className="fw-bold pb-2"> Select Day </h2>
      <h2 className="fw-bold pb-4">{program.name}</h2>
      <br />
      <Carousel>
        {days.map((day) => {
          return (
            <div className="d-flex justify-content-center" key={day.id}>
              {day.id}
            </div>
          );
        })}
      </Carousel>
    </div>
  );
};

SelectDay.propTypes = {
  program: PropTypes.object,
  next: PropTypes.func,
  prev: PropTypes.func,
  step: PropTypes.number,
};
